const getTheTitles = function(books) {
    const books=[
        {
            title: 'Book',
            author: 'Name'
          },
          {
            title: 'Book2',
            author: 'Name2'
          }
    ]
    let arrLen = books.length;
    for (let i = 0; i <= arrLen; i++){
        return books.title;
    }
};

